import React from 'react';
import { Link } from 'react-router-dom';

const NavigationBar = () => {
    return (
        <div className="nav-bar container">
            <nav className="nav nav-wrapper grey-darken-3">
                <Link className="brand-logo">CN</Link>
            </nav>
        </div>
    )
}

export default NavigationBar;
